function generateCards(data, parentElem) {
    for(let item in data) {
//создаем див
        let card = document.createElement("div");
        card.classList.add("card");
        let title = document.createElement("h2");
        title.innerText = data[item]["title"];
        // goods["piano"]["title"]
        // goods["guitar"]["title"]
        // goods["drum"]["title"]
        // goods["flute"]["title"]
        let pic = document.createElement("img");
        pic.setAttribute("src",
            "img/" + data[item]["img"]);
        let price = document.createElement("p");
        price.innerText = `Цена: ${data[item]["price"]}`;

        card.append(title, pic, price);

        parentElem.append(card);
    }
    
}

let section = document.querySelector(".goods");
generateCards(goods, section);